import React from 'react'
import { ImCross } from 'react-icons/im'

const ContactForm = ({HandleToggleForm, Items}) => {
  return (
    <div className='bg-gray-300 w-[400px] h-[500px] absolute top-[20%] right-[40%] rounded-[10px]'>
      <ImCross onClick={()=>{HandleToggleForm()}} className='w-[30px] h-[30px] float-right mt-[10px] mr-[10px] p-[8px] hover:bg-slate-200 hover:rounded-full'></ImCross>
      <h1 className='font-medium text-[20px] text-center mt-[50px]' >{Items.name}</h1>
      <p className='italic ml-[10px] mt-[10px]'>{Items.type}</p>
      <p className='mt-[20px] ml-[20px] mr-[20px]'>{Items.desc}</p>
    </div>
  )
}

export default ContactForm
